<div className="logo">
<img id="logo1" src="https://divum.in/images/logo/Divum_Logo%20SVG%20(2).svg" alt="Logo" />
<div className="btnn">
<button type="submit" id="button"><Link to="/login">Add</Link></button>
</div>
</div>
<table>
<thead>
<tr>
{columns.map((column) => (
<th key={column.key}>{column.label}</th>
))}
</tr>
</thead>
<tbody>
{employee.map((employee) => (
<tr key={employee.id}>
<td>{employee.firstName}</td>
